    [Test]
    public void ConstantsAndCharacteristicPoints_Test()
    {

    Assert.AreEqual(0.018015268,_fluid.MolecularWeight, "MolecularWeight");
    Assert.IsTrue(IsInToleranceLevel(273.16, _fluid.TriplePointTemperature, 1E-4, 0.01),"TriplePointTemperature");
    Assert.IsTrue(IsInToleranceLevel(612.48, _fluid.TriplePointPressure, 1E-4, 0),"TriplePointPressure");
    Assert.IsTrue(IsInToleranceLevel(55496.9551400086, _fluid.TriplePointSaturatedLiquidMoleDensity, 1E-4, 0),"TriplePointSaturatedLiquidMoleDensity");
    Assert.IsTrue(IsInToleranceLevel(0.269470080866262, _fluid.TriplePointSaturatedVaporMoleDensity, 1E-4, 0),"TriplePointSaturatedVaporMoleDensity");
    Assert.IsTrue(IsInToleranceLevel(647.096, _fluid.CriticalPointTemperature, 1E-4, 0.01),"CriticalPointTemperature");
    Assert.IsTrue(IsInToleranceLevel(22063999.99999, _fluid.CriticalPointPressure, 1E-2, 0),"CriticalPointPressure");
    Assert.IsTrue(IsInToleranceLevel(17873.7279956, _fluid.CriticalPointMoleDensity, 1E-2, 0),"CriticalPointLiquidMoleDensity");
    Assert.IsTrue(IsInToleranceLevel(373.124295847699, _fluid.NormalBoilingPointTemperature.Value, 1E-4, 0.01),"NormalBoilingPointTemperature");
    Assert.IsTrue(_fluid.NormalSublimationPointTemperature is null,"NormalSublimationPointTemperature");
    }
